import useAuthContext from './auth/hooks/useAuthContext';

function Navbar(){

  const {login, loginAdmin} = useAuthContext();

  return (
    <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
      <a class="navbar-brand" href="/">
        <img src="https://static.wixstatic.com/media/2cd43b_fd0aba46da664bba9992400e48d51338~mv2_d_3543_4502_s_4_2.png/v1/fill/w_320,h_406,q_90/2cd43b_fd0aba46da664bba9992400e48d51338~mv2_d_3543_4502_s_4_2.png" alt="" width="30" height="30"></img>
        PUB
      </a>

      <div class="collapse navbar-collapse" id="navbarTogglerDemo02">
        <div class="navbar-nav">
          <a class="nav-item active nav-link" href="/">Principal</a>

        </div>
        
      </div>
      <button class="btn btn-outline-danger my-2 my-sm-2 my-lg-0" type="submit">Logout</button>
    </nav>
  )
}

export default Navbar;
